import "./navbar.css";

const Navbar = () => {
  return (
    <header className="navbar">
      <div className="logo">logo</div>
      <div className="links">
        <span className="link">Blog</span>
        <span className="link">Blog</span>
        <span className="link">Blog</span>
      </div>
      <div className="darkmode-toggle"></div>
      <div>Lang</div>
    </header>
  );
};

export default Navbar;
